import React from 'react';
import "./Header.css";

const Header = () => {
    return (
        <header>
            <img src="https://upload.wikimedia.org/wikipedia/commons/f/fa/Apple_logo_black.svg" alt=""/>
            <nav>
                <a href="">1</a>
                <a href="">2</a>
                <a href="">3</a>
                <a href="">4</a>
                <a href="">5</a>
            </nav>
        </header>
    );
}

export default Header;
